import axios from 'axios'

class Stable extends React.Component {
    gettingSoldiers = async () => {
        const api_url = await
        axios.get('http://127.0.0.1:7001/soldier/all');
        const dataa = await api_url.json();
        console.log(dataa);
    }

    render() {
        return (
            <div>
                <button onClick={this.gettingSoldiers}>CLC</button>
            </div>
        )
    }
}

export default Stable;
